import React from 'react';
import classes from './FAQ_preview.module.css'
import {questions} from './FAQ_Data'
import { HashLink } from 'react-router-hash-link';


const FAQ_preview = () => {

	const FAQ_nav = questions.map( (item) => 

	<div className = {classes.wrapper_question} key = {item.id} id= {item.id}>
		
			<div className={classes.question}>
				<div className={classes.img}>
				</div>
			<p className={classes.question}>{item.title}</p>
			
			<button className={classes.button}>See Answer</button>
	
		</div>
	</div>
	)

return(
	<div className={classes.FAQ}>
   <div className={classes.header}>
   <p className={classes.title}>FAQ</p> 
		{/* <Back/> */}
		</div>
	<div >
  {FAQ_nav}
	</div>
	</div>
)
}



export default FAQ_preview;
